import React from "react";
import { Route,Link } from "react-router-dom";

function MailCard(props) {
    let path = "/mail/" + props.id;
    return (
        <div>
            <Link to={path}>{props.name}</Link>
            <Route path="/mail/:id" component={MailCard}/>
        </div>
    )
}

export default MailCard;
